import styled from 'styled-components';

const Wrapper = styled.section`
  .card_box {
    width: 27rem;
    height: 25rem;
    background: #f5f5f5;
    background-repeat: no-repeat;
    background-position: center;
  }

  .flex_top_card {
    display: flex;
    padding: 0.12rem;
    align-items: center;
    justify-content: space-between;
  }
`;

export default Wrapper;
